import { NavLink } from "react-router-dom";
import { useAuth } from "../../context/AuthContext";

const AdminNavbar = () => {
  const { logout } = useAuth();

  return (
    <nav style={styles.AdminNavbar}>
      <nav className="w-100" style={styles.nav}>
        <div style={styles.logo}>Admin Dashboard</div>

        <div style={styles.links}>
          <NavLink to="/admin/users">Users</NavLink>
          <NavLink to="/admin/categories">Categories</NavLink>
          <NavLink to="/admin/products">Products</NavLink>
          <NavLink to="/admin/customers">Customers</NavLink>
          <NavLink to="/admin/orders">Orders</NavLink>
          <NavLink to="/admin/employees">Employees</NavLink>
          <NavLink to="/admin/sales">Sales</NavLink>
          <NavLink to="/admin/reservations">Reservations</NavLink>
        </div>

        <button className="btn btn-outline-danger" onClick={logout}>
          Logout
        </button>
      </nav>
    </nav>
  );
};

const styles = {
  AdminNavbar: {},
  nav: {
    maxwidth: "1400px",
    position: "fixed",
    height: "60px",
    background: "#fff",
    color: "#000",
    display: "flex",
    alignItems: "center",
    padding: "0 20px",
    justifyContent: "space-between",
  },
  logo: {
    fontWeight: "bold",
    fontSize: "18px",
  },
  links: {
    display: "flex",
    gap: "20px",
  },
  NavLink: {
    color: "#000",
    textDecoration: "none",
    fontSize: "14px",
  },
  active: {
    color: "#fff",
    borderBottom: "2px solid #3b82f6",
    paddingBottom: "4px",
  },
};

export default AdminNavbar;
